package com.icbc.bcss.trip.face.operationtools.apiDemo;

import com.alibaba.fastjson.JSONObject;

import java.util.UUID;

@Deprecated
public class FaceCompareDemo {

    /**
     * 调用的接口路径
     * 人脸比对   /davinci-portal
     */
    private static final String api = "/davinci-portal/engine-interface/face/similarity/image";

    /**
     * 接口加密密钥
     * 后台页面-系统管理-系统属性-安全配置-接口安全(此demo只有AES加密)
     */
    private static final String cypherKey = "12345678";

    /**
     * 渠道编码
     * 后台页面-系统管理-数据字典-渠道类型-详情-字典维护
     */
    private static final String channelCode = "0106";

    /**
     * 密钥
     * 后台页面-系统管理-人脸比对-详情-授权配置-app_key
     */
    private static final String app_key = "9839ecd7f363ceccae3f7e2192576189";

    /**
     * 密钥
     * 后台页面-系统管理-人脸比对-详情-授权配置-app_secret
     */
    private static final String app_secret = "1a4ffa28b24b460c8ece6eaa8eeb7f3d";

    /**
     * 随机字符
     * uuid随机字符
     */
    private static final String nonceStr = UUID.randomUUID().toString();

    /**
     * 时间戳
     * 当前时间戳
     */
    private static final Long timeStamp = System.currentTimeMillis();

    /**
     * 图片base64编码
     */
    private static final String imgA = "";

    /**
     * 图片base64编码
     */
    private static final String imgB = "";

    public static void main(String[] args) throws Exception {
        /**
         * gateway ip+端口
         */
        String ip_port = "http://localhost:8089";
        /**
         * 是否开启接口加密
         */
        boolean isInterfaceEncryption = false;

        /**
         * 请求参数
         */
        JSONObject param = new JSONObject();
        param.put("param", param);
        param.put("key", app_key);
        param.put("nonceStr", nonceStr);
        param.put("imgA", imgA);
        param.put("imgB", imgB);
        param.put("channelCode", channelCode);
        param.put("timeStamp", timeStamp);

        /**
         * 数据签名
         */
        param.put("sign", ToolUtil.makeSig(param, app_secret));

        String reqData = param.toJSONString();

        if (isInterfaceEncryption) {
            /**
             * 开启接口加密，参数AES加密
             */
            reqData = ToolUtil.encrypt(cypherKey, reqData);
        }

        String result = ToolUtil.postStr(ip_port + api, reqData, "UTF-8");

        if (isInterfaceEncryption) {
            /**
             * 开启接口加密，参数AES解密
             */
            result = ToolUtil.decrypt(cypherKey, result);
        }

        System.out.println("调用结果：" + result);
    }

}
